import "./Projects.css";
import calculator from "./images/Calculator.png";

export const CalculatorProject = (props) => {
  return(
    <div id="calc-project">
      <a id="calc-link" className="project-links" href="https://andrewchatch.github.io/JavaScript-Calculator/" target="_blank" rel="noreferrer">
        <img src={calculator} alt="Calculator" className="img-responsive project-img" />
        <div className="project-img-label text-center">JavaScript Calculator</div>
      </a>
    </div>
  );
};


export const DrumMachineProject = (props) => {
  return(
    <div id="drum-project">
      <a id="drum-link" className="project-links" href="https://codepen.io/andrewchatch/full/WNoKZwq" target="_blank" rel="noreferrer">
        <img src={drumMachine} alt="Drum Machine" className="img-responsive project-img" />
        <div className="project-img-label text-center">Drum Machine Project</div>
      </a>
    </div>
  );
};
